import React,{Component} from 'react';
import {
    ListWidget,
    ListItem,
    ListItemText,
    ListItemTextTile,
    ListItemTextBody

} from '../style';
class List extends Component{
    render(){
        return (
           <ListWidget>
               <ListItem>
                    <img className='ListImg' src='https://upload-images.jianshu.io/upload_images/2257068-610cbe7de087b61c?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240' alt='' />
                   <ListItemText>
                        <ListItemTextTile>从120斤到95斤的经验分享</ListItemTextTile>
                        <ListItemTextBody></ListItemTextBody>
                   </ListItemText>
               </ListItem>
           </ListWidget>
        )
    }
}   
export default List;
